//import "../../index.css"

const container = {
    backgroundColor:'#000',
    color:'white',
}

const text = {
    textAlign: 'center',
    fontSize: '30px'
}

const Footer = () => {
    return (
        <div>
            <footer className="w3-container w3-padding-32 w3-margin-top my-container">
                <p style={text}>Copyright 2022 Bishkek</p>
            </footer>
        </div>
    );
};

export default Footer;



